      };
    return (
        <div>
            <h1> Juliet is a full stack web developer with high demand skills such as React, Mongodb, and Nodejs. 
                
                 </h1>
                 <h4> I am based in San Francisco but</h4>

        </div>




    )
}

export default homePage;
